import { ReactComponent as SpotifyLogo } from '../../assets/logos/spotify-color-svgrepo-com.svg';
import './styles.css';

const ActivityTab = () => {
	return (
		<>
			<h5>Current Activity</h5>
			<div className="activity-container">
				<div className="activity-item">
					<div className="span-container">
						<div className="span-group">
							<span style={{ fontSize: '12px' }}>Listening to Spotify</span>
							<SpotifyLogo className="spotify-logo" />
						</div>
						<span style={{ fontSize: '12px', cursor: 'pointer' }}>. . .</span>
					</div>

					<div className="spotify-container">
						<img
							className="spotify-art"
							alt="Album Art"
							src="https://i.scdn.co/image/ab67616d0000b273aa9adbb6b712a555fab25274"
						/>
						<div className="spotify-info">SONG NAME</div>
						<div className="spotify-info">SONG AUTHOR</div>
					</div>
				</div>
				<div className="activity-item">
					{/* <div className="lorem"></div> */}
				</div>
				<div className="activity-item">
					{/* <div className="ipsum"></div> */}
				</div>
			</div>
		</>
	);
};

export default ActivityTab;
